import {View, Text} from 'react-native'

export default function ImagePicker(props){

    return (
        <View>
            <Text> MY FIRST COMPONENT! </Text>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },

  });
